#include<stdio.h>
static INT32_T _gbk_findCodeIndex(UINT16_T map[][2], UINT16_T code, INT32_T size)
{
	INT32_T low = 0, mid, height = size - 1;
	bool isUpSort = true;
	if ((map[height][0] - map[low][0]) > 0)
	{
		isUpSort = false;
	}
	while (low < height)
	{
		mid = (low + height) / 2;
		UINT16_T md = map[mid][0];
		if ((code - md) == 0)
		{
			return mid;
		}
		if ((code - md) < 0)
		{
			if (isUpSort)
				low = mid + 1;
			else
				height = mid;
		}
		else
		{
			if (isUpSort)
				height = mid;
			else
				low = mid + 1;
		}
	}
	return -1;
}
static UINT16_T _gbk_findCodeValue(UINT16_T map[][2], UINT16_T code, UINT16_T defVal)
{
	INT32_T index = _gbk_findCodeIndex(map, code, CODE_COUNT_UNICODE_GBK);
	if (index == -1)
		return defVal;
	return map[index][1];
}
//unicode in 0x00a4-0xfffd
//gbk in 0x8140-0xfeff
INT32_T AlgoGbkToUnicode32(UINT8_T * gbstr, UINT32_T * un32str, UINT16_T defVal = '?')
{
	INT32_T retSize = 0;
	UINT8_T * srcStr = gbstr;
	while ((*srcStr) != 0)
	{
		UINT8_T ch = *srcStr;
		if ((ch & 0x80) == 0)//ascii
		{
			if (un32str != NULL)
				*(un32str + retSize) = ch;
			retSize++;
			srcStr++;
		}
		else
		{
			if (*(srcStr + 1) == 0)
				return -1;

			UINT16_T dch = ((*srcStr) << 8) | (*(srcStr + 1));
			UINT32_T tch = (UINT32_T)_gbk_findCodeValue(codeMapGbk2Unicode, dch, defVal);
			if (un32str != NULL)
				*(un32str + retSize) = tch;
			retSize++;

			srcStr += 2;
		}

	}
	if (un32str != NULL)
	{
		*(un32str + retSize) = 0;
	}
	return retSize;
}
INT32_T AlgoUnicode32ToGbk(UINT32_T * un32str, UINT8_T * gbstr, UINT8_T defVal = '?')
{
	INT32_T retSize = 0;
	UINT32_T * srcStr = un32str;
	while ((*srcStr) != 0)
	{
		UINT32_T ch = *srcStr;
		if (ch < 0x80)
		{
			if (gbstr != NULL)
				*(gbstr + retSize) = (UINT8_T)(ch & 0xff);
			retSize++;
		}
		else
		{
			if (ch>0xffff)
			{
				if (gbstr != NULL)
					*(gbstr + retSize) = defVal;
				retSize++;
			}
			else
			{
				UINT16_T tch = _gbk_findCodeValue(codeMapUnicode2Gbk, (UINT16_T)(ch & 0xffff), defVal);
				if (tch == defVal)
				{
					if (gbstr != NULL)
						*(gbstr + retSize) = defVal;
					retSize++;
				}
				else
				{
					if (gbstr != NULL)
					{
						*(gbstr + retSize) = (UINT8_T)((tch >> 8) & 0xff);
						*(gbstr + retSize + 1) = (UINT8_T)(tch & 0xff);
					}
					retSize += 2;
				}
			}
		}
		srcStr++;
	}
	if (gbstr != NULL)
	{
		*(gbstr + retSize) = 0;
	}
	return retSize;
}


